func fmtMonth(locale, calendar, context, width string) func(int, string) string {
	indexes := monthLookup[locale]

	var i int16

	switch calendar {
	case "gregorian":
		switch width {
		case "abbreviated":
			if context == "format" {
				i = indexes.gregorianAbbrFormat
			} else {
				i = indexes.gregorianAbbrStandAlone
			}
		case "wide":
			if context == "format" {
				i = indexes.gregorianWideFormat
			} else {
				i = indexes.gregorianWideStandAlone
			}
		case "narrow":
			if context == "format" {
				i = indexes.gregorianNarrowFormat
			} else {
				i = indexes.gregorianNarrowStandAlone
			}
		}
	case "persian":
		switch width {
		case "abbreviated":
			if context == "format" {
				i = indexes.persianAbbrFormat
			} else {
				i = indexes.persianAbbrStandAlone
			}
		case "wide":
			if context == "format" {
				i = indexes.persianWideFormat
			} else {
				i = indexes.persianWideStandAlone
			}
		case "narrow":
			if context == "format" {
				i = indexes.persianNarrowFormat
			} else {
				i = indexes.persianNarrowStandAlone
			}
		}
	case "buddhist":
		switch width {
		case "abbreviated":
			if context == "format" {
				i = indexes.buddhistAbbrFormat
			} else {
				i = indexes.buddhistAbbrStandAlone
			}
		case "wide":
			if context == "format" {
				i = indexes.buddhistWideFormat
			} else {
				i = indexes.buddhistWideStandAlone
			}
		case "narrow":
			if context == "format" {
				i = indexes.buddhistNarrowFormat
			} else {
				i = indexes.buddhistNarrowStandAlone
			}
		}
	}

	names := calendarMonthNames[int(i)]

	return func(m int, _ string) string {
		return names[m-1]
	}
}

